import React, { useState } from "react";

const itemsList = () => {
  const [items, setItems] = useState([
    { name: "Cell Phone", id: 1 },
    { name: "Laptops", id: 2 },
    { name: "Tablets", id: 3 }
  ]);

  return (
    <div className="item-list">
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
      </ul>
    </div>
  );
};

export default itemsList;
